import React from 'react'
import { Shake } from 'reshake'

const ShakeButton = () => {
  return (
    <Shake 
    h={4}
    v={5}
    r={3}
    dur={890}
    int={5.2}
    max={100}
    fixed={true}
    fixedStop={true}
    freez={true}>
    <h1>&lt;Shake /&gt;</h1>
  </Shake>
  )
}

export default Shake
